import React, {useState} from "react";


export default function Todo(){

    return(
        <section id="todo">
            <div className="flex flex-row items-center">
                <div className="m-2 border w-1/3 rounded border-red-800 p-2">
                    <div>
                        <h2>Todo Item</h2>
                    </div>

                </div>
                <div className=" m-2 border w-1/3 rounded border-red-800 p-2">
                    <h3>Description</h3>
                </div>
                <div className=" m-2 self-end border w-1/3 rounded border-red-800 p-2">
                </div>
            </div>
        </section>
    );

}
